import { Injectable } from "@angular/core";
import { Product } from "./product.model";
import { Observable, from } from "rxjs";

@Injectable()
export class StaticDataSource {
private products: Product[] = [
new Product(1, "Chuteira", "Category 1", "Product 1 (Chuteira)",200,"data:image/jpeg;base64," ),

new Product(3, "Celular", "Category 1", "Product 2 (Celular)", 1000, "data:image/jpeg;base64,"),


new Product(5, "Capacete ", "Category 2", "Product 3(Capacete)", 650,"data:image/jpeg;base64,"),]

getProducts(): Observable<Product[]> {
return from([this.products]);
}
}
